import moment from "moment";
import React from "react";

const Session = ({
    sessionLengthSeconds,
    incrementSessionLength,
    decrementSessionLength
}) => {
    const sessionLengthMinutes = moment.duration(sessionLengthSeconds, 's').minutes();

    return (
        <div className="session-container">
            <p id="session-label">Session</p>
            <p id="session-length">{sessionLengthMinutes}</p>
            <button className="session-btn" id="session-increment" onClick={incrementSessionLength}>+</button>
            <button className="session-btn" id="session-decrement" onClick={decrementSessionLength}>-</button>
        </div>
    );
};

export default Session;
